import React, {useState} from 'react';
import '../assets/css/navbar.css';


const NavBar = (props) => {
    const [isNavCollapsed, setIsNavCollapsed] = useState(true);

    const handleNavCollapse = () => setIsNavCollapsed(!isNavCollapsed);
    return (
        <nav class='navbar navbar-expand-lg navbar-light' id='navigation-menu'>
            <a class="navbar-brand" href="#" id="logo">
                <img src={require("../assets/images/logo2.png")} alt="logo" />
                Joseph Bautista
            </a>

            <button class="navbar-toggler collapsed" id="navbar-button" type="button" data-toggle="collapse" data-target="#navbarNav" onClick={handleNavCollapse}>
                <span class="navbar-toggler-icon"></span>
            </button>

            <div class={`${isNavCollapsed ? 'collapse' : ''} navbar-collapse`} id="navbarNav">
                <div class="nav navbar-nav ms-auto">
                    <a class="nav-item nav-link active" href="#">Home</a>
                    <a class="nav-item nav-link" href="#">Profile</a>
                    <a class="nav-item nav-link" href="#">Projects</a>
                </div>
            </div>
        </nav>
    );
};

export default NavBar;
